import { useContext } from "react"
import { prodact1 } from "../‏‏App"

function NavBar(){
    const usecontext=useContext (prodact1)
    return(
        <>
        <h1>NavBar the length is{usecontext.length} </h1>
        {useContext.map((prodact)=><h1>prodact.titl</h1>)}
        </>
     
    )
}
export default NavBar
